import { Favorite } from "@material-ui/icons";
import { useState } from "react";
import BookingComp from "../components/BookingComp";
import ScrollToTopOnMount from "../components/ScrollToTopMount";
import FavoritesContext from "./FavoritesCtx";

function Booking() {
  const favoritesCtx = useState(FavoritesContext);

  let content;

  if (favoritesCtx.totalFavorites === 0) {
    <p>Booking is empty. Start Booking now.</p>;
  } else {
    content = <BookingComp />;
  }

  return (
    <div>
      <ScrollToTopOnMount />
      {content}
    </div>
  );
}

export default Booking;
